import React from "react";
import './Style.css';
const Card=()=>{
    return(
        <> 
           <div className="Card">
              <h2>1</h2>
              <div className="Image">
              <img src="https://oyster.ignimgs.com/mediawiki/apis.ign.com/pokemon-blue-version/d/d4/Charmander.gif" alt="IMAGE" />
              </div>
            \n
              <h2>Charmander</h2>
           </div>
        
        </>
    )
}
export default Card;
